Liverpool face another Barcelona transfer raid

 Liverpool are currently locked in an interesting battle with Thiago Alcantara and Gini Wijnaldum both at a contract crossroads. 
 Thiago is keen to sample life away from Bayern Munich, while Wijnaldum has not yet agreed a new deal with the Reds. Liverpool have been linked with the Spanish international, but it has been hard to find the funds to complete a deal. 
Talk of Wijnaldum joining Barcelona has increased the potential for an agreement to be reached.

Liverpool receive huge injury boost

 This week saw the return of Jordan Henderson and Joel Matip to training at Melwood . 
Matip’s campaign was disrupted by injuries including a three-month absence between October and January. He missed the final seven games of the season after departing during the goalless draw at Goodison Park.
The former Schalke man was absent for Saturday’s Community Shield defeat to Arsenal, and that saw 17-year-old Billy Koumetio named on the substitutes bench.
 It is a similar story for Henderson after he missed the final four games of the campaign. He was initially placed on crutches but has now back in the swing of things with the Reds first-team as he prepares to defend the Premier League.

Liverpool pinpoint game for fans’ return to Anfield
 Liverpool’s visit from Sheffield United on October 24 is expected to have supporters in attendance. 
 The Reds campaign starts with a visit from newly-promoted Leeds United on September 12, but they will be without the presence of fans for the first six weeks. 
 The club have been in dialogue with supporters groups since July and the hope is some compromise can be reached that would allow restricted numbers into Anfield . 

